import React, { useState } from 'react';
import './App.css';

function App() {
  const [feature, setFeature] = useState('');
  const [feedback, setFeedback] = useState('');
  const [feedbackSent, setFeedbackSent] = useState(false);

  // Example questions for predictors
  const mentalHealthQuestions = [
    'How often have you felt down, depressed, or hopeless in the last two weeks?',
    'How often have you had trouble concentrating on tasks?',
    'How often have you felt little interest or pleasure in doing things?',
    'How often have you felt nervous, anxious, or on edge?',
    'How often have you felt tired or had little energy?'
  ];
  const burnoutQuestions = [
    'How often do you feel emotionally exhausted by your work or studies?',
    'How often do you feel detached or cynical about your work?',
    'How often do you feel ineffective or unaccomplished in your role?',
    'How often do you feel overwhelmed by your responsibilities?',
    'How often do you feel you lack support from colleagues or supervisors?'
  ];

  // Placeholder for ML prediction (to be implemented)
  const handlePredict = (type) => {
    alert(`ML prediction for ${type} will be implemented here.`);
  };

  // Example exercises and tips
  const exercises = [
    'Guided Breathing: Inhale for 4, hold for 4, exhale for 4.',
    'Body Scan: Focus on relaxing each part of your body.',
    'Gratitude Reflection: Think of one thing you are grateful for today.',
    'Take a short mindful walk.'
  ];
  const tips = [
    'Maintain a regular sleep schedule.',
    'Stay connected with friends and family.',
    'Take breaks and practice self-care.',
    'Seek help when you need it.'
  ];

  return (
    <div className="App">
      <header className="App-header">
        <h2>Mental Health & Burnout Risk App</h2>
        <div style={{margin: '20px 0'}}>
          <button onClick={() => setFeature('mental')}>Mental Health Predictor</button>
          <button onClick={() => setFeature('burnout')}>Burnout Risk Predictor</button>
          <button onClick={() => setFeature('exercises')}>Exercises & Tips</button>
          <button onClick={() => setFeature('support')}>Support</button>
          <button onClick={() => setFeature('feedback')}>Feedback</button>
        </div>
        {feature === 'mental' && (
          <div>
            <h3>Mental Health Predictor</h3>
            <ol>{mentalHealthQuestions.map((q, i) => <li key={i}>{q}</li>)}</ol>
            <button onClick={() => handlePredict('mental health')}>Predict (ML Coming Soon)</button>
            <button onClick={() => setFeature('')}>Back</button>
          </div>
        )}
        {feature === 'burnout' && (
          <div>
            <h3>Burnout Risk Predictor</h3>
            <ol>{burnoutQuestions.map((q, i) => <li key={i}>{q}</li>)}</ol>
            <button onClick={() => handlePredict('burnout risk')}>Predict (ML Coming Soon)</button>
            <button onClick={() => setFeature('')}>Back</button>
          </div>
        )}
        {feature === 'exercises' && (
          <div>
            <h3>Exercises to Calm</h3>
            <ul>{exercises.map((ex, i) => <li key={i}>{ex}</li>)}</ul>
            <h3>Tips for Good Mental Health</h3>
            <ul>{tips.map((tip, i) => <li key={i}>{tip}</li>)}</ul>
            <button onClick={() => setFeature('')}>Back</button>
          </div>
        )}
        {feature === 'support' && (
          <div>
            <h3>Support</h3>
            <p>This feature will be available soon.</p>
            <button onClick={() => setFeature('')}>Back</button>
          </div>
        )}
        {feature === 'feedback' && (
          <div>
            <h3>Feedback</h3>
            {feedbackSent ? (
              <p>Thank you for your feedback!</p>
            ) : (
              <>
                <textarea value={feedback} onChange={e => setFeedback(e.target.value)} placeholder="Your feedback..." rows={4} style={{width:'80%'}} />
                <br />
                <button onClick={() => { setFeedbackSent(true); }}>Submit</button>
                <button onClick={() => setFeature('')}>Back</button>
              </>
            )}
          </div>
        )}
      </header>
    </div>
  );
}

export default App;
